dynamic_creation_script.display_value:
var existing = new GlideRecord(current.getTableName());
        existing.query('name', value);
        if (existing.next()) {
        existing.sys_id.toString();
        } else {
        current.name = value;
        if (current.sys_scope.nil())
        current.sys_scope = parent.sys_scope;
        if (! current.sys_scope.nil() && current.getValue("sys_scope") !== "global")
        current.suffix = getSuffix(value);
        current.insert();
        }
        function getSuffix(name) {
        if (null == name || typeof name == 'undefined' || name.length < 1 || !name)
        return '';
        var nameArr = name.split('.');
        if (nameArr.length < 2)
        return "";
        nameArr.shift();
        return nameArr.join(".");
        }

